import {Routes, Route} from 'react-router-dom';
import Login from './Login/Login';
import MainPage from "./MainPage/MainPage";

const App=()=>{
    return (
        <Routes>
            <Route path="/" element={<Login/>}/>
            <Route path="/home" element={<MainPage/>}/>
        </Routes>
    )
}

export default App
